import React from 'react';
import { Table, Image, Progress, Badge, Dropdown, Space, TableColumnsType } from 'antd';
import type { ColumnsType } from 'antd/es/table';
import { ArrowDownOutlined, ArrowUpOutlined, DownOutlined } from '@ant-design/icons';

import FillCell from './FillCell/FillCell';


interface IVisits {
  time: string;
  length: number;
  image1: string;
  image2: string;
}

interface IData {
  date: string;
  visits: IVisits[];
}


// interface DataType {
//   key: React.Key;
//   name: string;
//   platform: string;
//   version: string;
//   upgradeNum: number;
//   creator: string;
//   createdAt: string;
// }
interface DataType {
  key: React.Key;
  date: string;
  timeVisit1: string;
  lengthVisit1: number;
  imageVisit1: string[];

  timeVisit2: string;
  lengthVisit2: number;
  imageVisit2: string[];
  
  visitsPlus: IVisits[];
}

interface ExpandedDataType {
  key: React.Key;
  time: string;
  length: number;
  image1: string;
  image2: string;
}




const _Table2 = ({ tableData }: { tableData: IData[] }) => {
    
  const expandedRowRender = (visits: IVisits[]) => {
    const columns: TableColumnsType<ExpandedDataType> = [
      { title: 'Обход', dataIndex: 'time', width: 80, key: 'time' },
      {
        title: 'Длительность', key: 'length', width: 150, render: (_, { length }) => (
          <FillCell value={length} /> 
        )
      },
      {
        title: 'Камеры', key: 'imagePlusVisit1', render: (_, { image1, image2 }) => (
          <>
            <Image.PreviewGroup
              items={[image1, image2]}
            >
              <Image
                src={process.env.REACT_APP_SERVER_URL + '/files/' + 'cam03.png'}
                width={25}
                height={25}
                fallback="data:image/png;base64,"
              />
            </Image.PreviewGroup>
          </>
        )
      },
    ];
    
    const data: ExpandedDataType[] = [];
    visits.forEach((item, idx) => {
      data.push({
        key: idx.toString(),
        time: item.time,
        length: item.length,
        image1: item.image1,
        image2: item.image2,
      });
    });
    
    return <Table columns={columns} dataSource={data} pagination={false} />;
  };


  const columns: TableColumnsType<DataType> = [
    { title: 'Дата', dataIndex: 'date', width: 100, key: 'date' },
    { title: 'Обход 1', dataIndex: 'timeVisit1', width: 85, key: 'timeVisit1' },
    {
      title: 'Длительность', key: 'lengthVisit1', render: (_, { lengthVisit1 }) => (
        <>
          {lengthVisit1 > 0 ? <FillCell value={lengthVisit1} /> : <p>Обхода не было</p>}
        </>
      )
    },
    {
      title: 'Камеры', key: 'imageVisit1', render: (_, { imageVisit1 }) => (
        <>
          {imageVisit1.length > 0 && <Image.PreviewGroup
            items={imageVisit1}
          >
            <Image
              src={process.env.REACT_APP_SERVER_URL + '/files/' + 'cam03.png'}
              width={25}
              height={25}
              fallback="data:image/png;base64,"
            />
          </Image.PreviewGroup>}
        </>
      )
    },
    { title: 'Обход 2', dataIndex: 'timeVisit2', key: 'timeVisit2' },
    {
      title: 'Длительность', key: 'lengthVisit2', render: (_, { lengthVisit2 }) => (
        <>
          {lengthVisit2>0 ? <FillCell value={lengthVisit2} /> : <p>Обхода не было</p>}
        </>
      )
    },
    {
      title: 'Камеры', key: 'imageVisit2', render: (_, { imageVisit2 }) => (
        <>
          {imageVisit2.length > 0 && <Image.PreviewGroup
            items={imageVisit2}
          >
            <Image
              src={process.env.REACT_APP_SERVER_URL + '/files/' + 'cam03.png'}
              width={25}
              height={25}
              fallback="data:image/png;base64,"
            />
          </Image.PreviewGroup>}
        </>
      )
    },
  ];

  const data: DataType[] = [];
  tableData.forEach((item, idx) => {

    // for (let i = 0; i < item.visits.length; i++) {

    // }

    const timeVisit1 = item.visits[0] ? item.visits[0].time : '';
    const lengthVisit1 = item.visits[0] ? item.visits[0].length : 0;
    // const imageVisit1 = [item.visits[0] ? item.visits[0].image1 : '', item.visits[0] ? item.visits[0].image2 : ''];
    const imageVisit1 = item.visits[0] ? [item.visits[0].image1, item.visits[0].image2] : [];

    const timeVisit2 = item.visits[1] ? item.visits[1].time : '';
    const lengthVisit2 = item.visits[1] ? item.visits[1].length : 0;
    // const imageVisit2 = [item.visits[1] ? item.visits[1].image1 : '', item.visits[1] ? item.visits[1].image2 : ''];
    const imageVisit2 = item.visits[1] ? [item.visits[1].image1, item.visits[1].image2] : [];
    
    const visitsPlus = item.visits[2] ?  item.visits.slice(2) : [];
    data.push({
      key: idx.toString(),
      date: item.date,
      timeVisit1: timeVisit1,
      lengthVisit1: lengthVisit1,
      imageVisit1: imageVisit1,

      timeVisit2: timeVisit2,
      lengthVisit2: lengthVisit2,
      imageVisit2: imageVisit2,
      visitsPlus: visitsPlus,
    });
    
    // console.log(data[idx].visitsPlus)
    // console.log(item.visits[1] ? item.visits.slice(1) : [])
    
  });
  

  return (

    <Table
      columns={columns}
      // expandable={{ expandedRowRender, defaultExpandedRowKeys: ['0'] }}
      expandable={{
        // expandedRowRender : (record, i) => <p>{record.key}</p>,
        expandedRowRender : (record) => expandedRowRender(record.visitsPlus),
        rowExpandable: (record) => record.visitsPlus.length > 0,
      }}
      dataSource={data}
      size="small"
      scroll={{ x: 775, y: 470 }}
      pagination={{
        defaultPageSize: 10,
        showSizeChanger: true,
        pageSizeOptions: [10, 15, 20],
      }}
    />

  );
};

export default _Table2;